//   </Provider>,
//   document.getElementById('root')
// )

// ReactDOM.render(
//   <Provider store = {store}>
//     <Authorisation/>
//   </Provider>,
//   document.getElementById('root')
// )


// ReactDOM.render(
//   <Provider store = {store}>
//     <Dialogs/>
//   </Provider>,
//   document.getElementById('root')
// )

  ReactDOM.render(
    <Provider store = {store}>
      <Router>
        <Route path="/" component={Authorisation}/>
        <Route path="/registration" component={Registration}/>
      </Router>
    </Provider>,
    document.getElementById('root')
  )
